from typing import List
class Solution:
    def minDominoRotations(self, A: List[int], B: List[int]) -> int:
        assert A and B and len(A) == len(B)
        def helper(candidate, A, B):
            res = 0
            for i in range(len(A)):
                if A[i] != candidate:
                    if B[i] == candidate:
                        res += 1
                    else:
                        return -1
            return res
        
        res1 = helper(A[0], A, B)
        res2 = helper(B[0], B, A)
        res3 = helper(A[0], B, A)
        res4 = helper(B[0], A, B)

        if res1 == res2 == res3 == res4 == -1:
            return -1
        else:
            return min(res for res in (res1, res2, res3, res4) if res != -1)

